	// length of 2 (where (1, 5) are first and last nodes of the path and can
	// therefore not be moved):
	//   1 ->  4 -> [2 -> 3] -> 5
	//   1 -> [3 -> 4] -> 2  -> 5
	// The OR_OPT operator is a limited version of 3-Opt (breaks 3 arcs on a
